import React from 'react';
import '../styles/home.css';

import { Container, Row, Col } from 'reactstrap';
import heroImg from '../assets/images/hero-img01.jpg';
import heroImg02 from '../assets/images/hero-img02.jpg';
import heroVideo from '../assets/images/hero-video.mp4';
import worldImg from '../assets/images/world.png';
import Subtitle from '../shared/Subtitle';

import SearchBar from '../shared/SearchBar';

const Home = () => {
  return (
    <>
      {/*======= Hero section start =======*/}
      <section>
        <Container>
          <Row>
            <Col lg="6">
              <div className="hero__content">
                <div className="hero__subtitle d-flex align-items-center">
                  <Subtitle subtitle={'Know before you go'} />
                  <img src={worldImg} alt="globe" />
                </div>
                <h1>
                  Travelling opens the door to creating{' '}
                  <span className="highlight">memories</span>
                </h1>
                <p>
                  Lorem ipsum dolor sit amet, consectetur adipisicing elit.
                  Minus odio impedit laborum. Laudantium quos ea iste quasi
                  dolor maiores impedit beatae! Iste incidunt id facilis?
                  Aperiam odit adipisci fugiat eaque?
                </p>
              </div>
            </Col>

            <Col lg="2">
              <div className="hero__image-box">
                <img src={heroImg} alt="displaying" />
              </div>
            </Col>

            <Col lg="2">
              <div className="hero__image-box mt-4">
                <video src={heroVideo} controls />
              </div>
            </Col>

            <Col lg="2">
              <div className="hero__image-box mt-5">
                <img src={heroImg02} alt="displaying" />
              </div>
            </Col>
          </Row>

          {/* SearchBar should be outside the Row */}
          <SearchBar />
        </Container>
      </section>
      {/*======= Hero section end =======*/}
    </>
  );
};

export default Home;
